"use strict";tripnoutApp.controller("homeController",function(s,o){s.processing=!0,s.load=!0;var t=0,e=1,n=1;o.latest(n,t).success(function(o){s.processing=!1,s.trips=o}),s.loadMore=function(){e++,t=e*n-n,o.latest(n,t).success(function(o){if(o.length){for(var t=0;t<o.length;t++)s.trips.push(o[t]);s.processing=!1}else s.load=!1,s.processing=!1})}});